description:
Position Description
Anne Arundel County Government is seeking an ArundelStat Performance and Data Analyst to support departments across Anne Arundel County Government by performing a wide variety of analytical, assessment, and administrative duties.
This is a professional level position in the Office of the County Executive who will report to the Director of ArundelStat. This full-time exempt position is responsible for conducting research and collecting data to conduct analyses, developing presentations, and recommending data-driven solutions that will assist County departments in performance improvement using a wide range of analytical tools and methods in addition to collaborating on the open data initiative.
Examples of Duties and Knowledge, Skills and Abilities
Develop and track performance metrics in line with the County's goals and priorities, identifying areas that may need further review;
Create data visualizations and end-user reports;
Manage ongoing agency performance tasks for the performance improvement initiatives which includes things like troubleshooting issues as they arise to updating tracking sheets and backend of visualizations annually;
Work collaboratively with County agencies to leverage institutional and other public source data (e.g. Census data) to identify opportunities for operational improvement;
Organize and convene performance improvement meetings;
Compile, process, and analyze administrative and public source data in a clear and concise manner;
Support the ArundelStat team in the administration of a variety of projects;
Proficient in data analysis techniques, with an understanding of basic statistical concepts;
Familiarity with Geographic Information Systems (GIS) mapping software such as ESRI;
Knowledge of statistical software packages such as R, STATA, or SPSS;
Knowledge of databases, APIs, AI tools, and programming languages such as MySQL or PostGreSQL, and open source programming languages such as Perl and PHP;
Knowledge of online data visualization platforms such as Quicksight, Tableau, or ESRI
Required Knowledge and Skills:
Possession of a four-year degree from an accredited college or university in Business or Public Administration, Research and Evaluation, Information Systems, Information Technology, Operations Research, or a related field;
Two (2) or more years of professional experience performing data analysis and results dissemination, program evaluation and/or process improvement in an academic, data administration, or business analytics environment;
Strong interpersonal skills with the capacity to collaborate across many different County agencies and stakeholder groups;
Ability to explain complex, technical information to a non-technical audience;
Fluency in Google Suite and/or Microsoft Office Suite.
Anne Arundel County Government offers an excellent benefit package and salary commensurate with the candidates qualifications and responsibilities.
The starting salary range is $65,000 to $75,000 and is eligible for semi-remote work.
Applications will be accepted until the position has been filled.
Note - A thorough background is required for this position.
